import Foundation
import XCTest

@testable import SystemStrings

// MARK: - iAd Tests

@available(iOS 7.1, *)
final class iAdStringsTests: XCTestCase {

    override func tearDown() {
        super.tearDown()
        Util｜iAd.preferredLocalization = nil
    }

    func test_default() {
        Util｜iAd.preferredLocalization = nil
        XCTAssertEqual(String._0：00｜iAd, "\u{30}\u{3A}\u{30}\u{30}")
        XCTAssertEqual(String.Ad｜iAd, "\u{41}\u{64}")
        XCTAssertEqual(String.Ad_asset_still_loading．｜iAd, "\u{41}\u{64}\u{20}\u{61}\u{73}\u{73}\u{65}\u{74}\u{20}\u{73}\u{74}\u{69}\u{6C}\u{6C}\u{20}\u{6C}\u{6F}\u{61}\u{64}\u{69}\u{6E}\u{67}\u{2E}")
        XCTAssertEqual(String.Ad_data_validation_failure．｜iAd, "\u{41}\u{64}\u{20}\u{64}\u{61}\u{74}\u{61}\u{20}\u{76}\u{61}\u{6C}\u{69}\u{64}\u{61}\u{74}\u{69}\u{6F}\u{6E}\u{20}\u{66}\u{61}\u{69}\u{6C}\u{75}\u{72}\u{65}\u{2E}")
        XCTAssertEqual(String.Ad_inventory_unavailable｜iAd, "\u{41}\u{64}\u{20}\u{69}\u{6E}\u{76}\u{65}\u{6E}\u{74}\u{6F}\u{72}\u{79}\u{20}\u{75}\u{6E}\u{61}\u{76}\u{61}\u{69}\u{6C}\u{61}\u{62}\u{6C}\u{65}")
        XCTAssertEqual(String.Ad_serving_failed_due_to_WebKit_termination．｜iAd, "\u{41}\u{64}\u{20}\u{73}\u{65}\u{72}\u{76}\u{69}\u{6E}\u{67}\u{20}\u{66}\u{61}\u{69}\u{6C}\u{65}\u{64}\u{20}\u{64}\u{75}\u{65}\u{20}\u{74}\u{6F}\u{20}\u{57}\u{65}\u{62}\u{4B}\u{69}\u{74}\u{20}\u{74}\u{65}\u{72}\u{6D}\u{69}\u{6E}\u{61}\u{74}\u{69}\u{6F}\u{6E}\u{2E}")
        XCTAssertEqual(String.Ad_serving_failed_due_to_global_exclusion．｜iAd, "\u{41}\u{64}\u{20}\u{73}\u{65}\u{72}\u{76}\u{69}\u{6E}\u{67}\u{20}\u{66}\u{61}\u{69}\u{6C}\u{65}\u{64}\u{20}\u{64}\u{75}\u{65}\u{20}\u{74}\u{6F}\u{20}\u{67}\u{6C}\u{6F}\u{62}\u{61}\u{6C}\u{20}\u{65}\u{78}\u{63}\u{6C}\u{75}\u{73}\u{69}\u{6F}\u{6E}\u{2E}")
